question_with_variants:
Refer to the nextIntInRangemethod below:
 /** @return a random integer in the range low to high, inclusive */
 public int nextIntInRange(int low, int high)
 {
 return /* expression */
 }
 Which /* expression */ will always return a value that satisfies the postcondition?

1) (int) (Math.random() * (high + 1 - low)) + low;
2) (int) (Math.random() * (high + low)) + low;
3) (int) (Math.random() * (high - low + 1)) + low;
4) (int) (Math.random() * (high - low + 1)) + high;
5) (int) (Math.random() * high) + low;
6) (int) (Math.random() * (high - low)) + high;
7) (int) (Math.random() * (high - low - 1)) + low;
8) (int) (Math.random() * (high + low - 1)) + low;
9) (int) (Math.random() * (high + low + 1)) + low;
10) (int) (Math.random() * (high - low)) + low;

